Select count(id) from likes;
Select * from likes limit 10;

-- List all likes on a specific post:
SELECT u.username
FROM likes l
JOIN users u ON l.user_id = u.id
WHERE l.post_id = 5;

-- Count likes on a specific post:
SELECT COUNT(*) AS like_count
FROM likes
WHERE post_id = 1;

Select * from likes limit 10;

SELECT COUNT(post_id) AS like_count, user_id
FROM likes
GROUP BY user_id
ORDER BY like_count DESC;

SELECT COUNT(user_id) AS like_count, post_id
FROM likes
GROUP BY post_id
ORDER BY like_count DESC;

Select count(post_id) as posts
from likes;

